import React from 'react';
//import Word from "../assets/Word";

class WordTable extends React.Component {

  constructor(props) {
    super(props);
  }
  
  buildWordList = () => {
    return (
        <div>
          {this.props.wordList.map(word => 
            <h1>{word['wordList']} - {word['type']}</h1>   
          )}
        </div>
      )
  }

  render() {
    return (
      <div style={{ textAlign: "center" }}>
        {this.buildWordList()}
      </div>
    );
  }
}

export default WordTable;
